import React from 'react';
import Link from 'next/link';

const navbar = () => (
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/about"><a>About</a></Link></li>
        </ul>
        <style jsx>{`
            ul {
                background: #333;
                color: #fff;
                list-style:none;
                display: flex;
                margin:0;
            }

            ul li {
                margin-right: 1em;
            }

            ul li a{
                color: #ffffff;
                text-decoration: none;
                font-size: 1.3em;
                font-family: monospace;
            }
        `}</style>
    </div>
);

export default navbar;
